import React from 'react'
import {HiArrowNarrowRight} from 'react-icons/hi'
const Home = () => {
  return (
    <div name='home' className='w-full h-screen bg-[black]'>
        {/* Container */}
        <div className='mx-60 px-8 flex flex-col justify-center h-full'>
            <h2 className= 'text-purple-600 text-4xl md:text-6xl'>Hi, I am Abhishek</h2>
            <h2 className=' text-purple-600 text-4xl md:text-6xl'>An aspiring Data Scientist.</h2>
            <p className='text-white mt-5'>Machine Learning, Deep Learning & Computer Vision</p>
        </div>
    </div>
  )
}

export default Home
